import React from 'react';
import { Route, Routes} from "react-router-dom"
import DrugInputs from './druginput';
import routes from './routes/routes';
import Showdrugs from './showdrugs';



function App() {
  return (
    <div className="App"> 
    <Showdrugs/>
    <DrugInputs/>
<Routes>

   {routes.map((route) => (
                <Route
                path={route.path}
                element={route.e}
                />
               ))}
    </Routes>



    </div>



  );
}

export default App;
